import {useState, useEffect} from "react";
import { Routes, Route } from "react-router-dom";

import "./App.scss";

//components
import Hamburger from "./Components/Hamburger/Hamburger";
import Menu from "./Components/Menu/Menu";

//pages
import Home from "./Pages/Home/index";
import Education from "./Pages/Education/index";
import Portfolio from "./Pages/Portfolio/index";
import Contact from "./Pages/Contact/index";

const App = () => {

  const [menuState, toggleMenu] = useState(false);

  const _handleClick = e => {
    toggleMenu(false);
  }

  const _handleScroll = e => {
    toggleMenu(false);
    console.log("scrolling");
  }

  useEffect(() => {
    const container = document.getElementById("container");
    container.addEventListener("click", _handleClick);
    window.addEventListener("scrollDown", _handleScroll);

    return() => {
      container.removeEventListener("click", _handleClick);
      window.addEventListener("scroll", _handleScroll);
    }
  },[])

  return (
    <div className="App">
      <header>
        <Hamburger menuState={menuState} toggleMenu={toggleMenu} />
      </header>
      <Menu menuState={menuState} toggleMenu={toggleMenu} />
      <div id="container">
        <div id="background">
        </div>
        <div id="article-wrapper">
          <div id="bio">
              <div id="info">
                <div className="title">Rohit Naidu</div>
                <div id="socials">
                  <a href="https://github.com/rohtett/" target="_blank">
                    <div className="github" />
                  </a>
                  <a href="https://www.linkedin.com/in/rohtett/" target="_blank">
                    <div className="linkedin" />
                  </a>
                </div>
              </div>
          </div>

        </div>
      </div>
    </div>
  );
}

const Landing = () => {
  return (
    <article>
      <h3>Error 404: Page not Found</h3>
      <p> Please use the navigation bar to locate to another page.</p>
    </article>
  )
}


export default App;
